import { useReducer} from "react";
import Header from "./Header";
import Footer from "./Footer";
import BookingForm from "./BookingForm";

const updateTimes=(availabeTimes,action)=>{
    if(action.payload === "2024-04-04"){
        return [""]
    }

    return availabeTimes;

}
export const initialTimings=()=>{return ["17:00","18:00","19:00","20:00","21:00"]};

function BookingPage(){

    const [availabeTimes,dispatch]=useReducer(updateTimes,initialTimings())

    return (
        <>
        <Header />
        <BookingForm timings={availabeTimes} dispatch={dispatch} />
        <Footer />
        </>
    )
}

export default BookingPage;
